import React, { useContext } from 'react'
import { GlobalContext } from '../context/GlobalState';

export const Foods = ({ foods }) => {
  const { deleteFood } = useContext(GlobalContext);

  // const difference = foods.amount

  return (
    <li className="fooditem">
        {foods.text} <span>{foods.amount}g</span><button
        onClick={() => deleteFood(foods.id)} className="delete-btn">x</button>
    </li>
  )
}
